import math
import statistics as stats
import pandas as pd

# ================== Tunables ==================
FINAL_WINDOW    = 100   # average over the last N points for "final convergence energy"
SMOOTH_WINDOW   = 20    # rolling-mean window for stability check
TOL_FACTOR      = 1.0   # tolerance = TOL_FACTOR * std(final window)
ABS_MIN_TOL     = 0.0   # absolute floor on tolerance (e.g., 1e-3)
HIT_WINDOW      = 10    # need this many consecutive rolling means inside the band to say "reached target"
# ==============================================

def final_avg_std(energies, k):
    k = min(k, len(energies))
    tail = energies[-k:] if k > 0 else energies
    if not tail:
        return None, None
    if len(tail) == 1:
        return float(tail[0]), 0.0
    return float(sum(tail)/len(tail)), float(stats.pstdev(tail))

def rolling_means(energies, w):
    n = len(energies)
    w = min(w, n)
    if w <= 0 or n == 0:
        return []
    csum = [0.0]
    for e in energies:
        csum.append(csum[-1] + e)
    return [(csum[i+w]-csum[i])/w for i in range(0, n-w+1)]

def wsbd_converged_target(fp_energy_pairs, final_window=FINAL_WINDOW, tol_factor=TOL_FACTOR, abs_min_tol=ABS_MIN_TOL):
    """Return (target_energy, tol) from a WSBD run's tail."""
    if not fp_energy_pairs:
        return None, None
    data = sorted(fp_energy_pairs, key=lambda x: x[0])
    Es  = [e for _, e in data]
    fmean, fstd = final_avg_std(Es, final_window)
    if fmean is None:
        return None, None
    tol = max(tol_factor * (0.0 if math.isnan(fstd) else fstd), abs_min_tol)
    return fmean, tol

def time_to_reach_target(fp_energy_pairs, target, tol, smooth_window=SMOOTH_WINDOW, hit_window=HIT_WINDOW):
    """
    Earliest FP where the rolling mean enters [target  tol] and stays there for
    at least `hit_window` consecutive windows. Returns None if never.
    """
    if not fp_energy_pairs or target is None or tol is None:
        return None
    data = sorted(fp_energy_pairs, key=lambda x: x[0])
    fps = [fp for fp, _ in data]
    Es  = [e  for _,  e in data]

    rms = rolling_means(Es, max(1, min(smooth_window, len(Es))))
    if not rms:
        return None

    L = len(rms)
    for i in range(L):
        need = min(hit_window, L - i)
        ok = True
        for j in range(i, i + need):
            if abs(rms[j] - target) > tol:
                ok = False
                break
        if ok:
            return fps[i]  # FP at start of the qualifying window
    return None

